    func format_EEC_Mnemonic(str : String) -> String {
// this is used to format EEC_Mnemonic string value. it will return anything before the first + sign.
// if there is no + sign, it will resturn normal input string.
        var returnStr = str
        if let plusSignRance = returnStr.range(of: "+") {
            returnStr.removeSubrange(plusSignRance.lowerBound..<str.endIndex)
        }
        return returnStr
    }
    
    
    /*
     for bits table, it has to have
     SOME_UNIQUE_IDENTIFIER(mix it with ACparameter and EEC Menomic maybe?) | BITNUM | 0VAL | 1VAL | LABEL
     
     BITNUM, 0VAL, 1VAL, LABEL, just make them equal to "UNDECIDED" or "UNDEC" so you can track it better later.
     of course, skip the SPAR data type. we dont need that. 
     */
    
    
    
// where all main work is happening
    func formatBlock (json : JSON) -> String{
        var str = "$RECEIVER "  // first line of the block.
        str += json["pageTables"][0]["tables"][0][2].stringValue.replacingOccurrences(of: " ", with: "") + " PORT=UNDECIDED ACTIVE=UNDECIDED\n*\n" // frame designation
        
        let numberOfPages = json["numPages"].intValue // how many pages?
        var i = 0
        
        var lastDatasetDestination = ""
        var bitnum = 1
        
        while (i<numberOfPages) {
        
            var n = 2  // index 2 is where meaningful data starts.
            while (n < 10) {  // in completion of this while loop, one row will be written
                if json["pageTables"][i]["tables"][n][6].stringValue.replacingOccurrences(of: " ", with: "") == "SPAR" || json["pageTables"][i]["tables"][n][1].stringValue.replacingOccurrences(of: " ", with: "") == ""{
                    n = n + 1
                    // this if conditional check SPARE type or dummy shit
                }
                    
               else if (json["pageTables"][i]["tables"][n][0].stringValue == json["pageTables"][i]["tables"][n-1][0].stringValue){
                    //bits concat operation starts here.
                    str.removeLast(11)
                    str += "$BITS\n"
                    
                    print ("entering while loop for BITS operation ")
                    print (json["pageTables"][i]["tables"][n][0].stringValue + " VS " + json["pageTables"][i]["tables"][n-1][0].stringValue)
                    
                    
                    while (json["pageTables"][i]["tables"][n][0].stringValue == json["pageTables"][i]["tables"][n-1][0].stringValue) {
                        
                        if json["pageTables"][i]["tables"][n][6].stringValue.replacingOccurrences(of: " ", with: "") == "SPAR" {
                            n+=1
                        } else {
                            str += json["pageTables"][i]["tables"][n][0].stringValue + "BITNUM=" + String(bitnum) + " 0VAL= 1VAL= LABEL=\n"
                            bitnum+=1
                            n+=1
                        }
                    }
                    str+="$END-BITS\n$END-FDS\n*\n"
                    bitnum = 1 // resetting the bitnum 
                }
                
                else {
                    print (n)
                    str = str + "FDS A1_"
                    str = str + json["pageTables"][i]["tables"][n][0].stringValue.replacingOccurrences(of: " ", with: "").uppercased() + "_FS STATUS=UNDECIDED\n" // Data Designation
                    str = str + "A1_"
                    str = str + format_EEC_Mnemonic(str:json["pageTables"][i]["tables"][n][7].stringValue.replacingOccurrences(of: " ", with: "")) // EEC Mnemonic
                    str = str + " TYPE=" + json["pageTables"][i]["tables"][n][6].stringValue.replacingOccurrences(of: " ", with: "")  // type
                    str = str + " SIZE=UNDECIDED ADDRESS=UNDECIDED"
                    if json["pageTables"][i]["tables"][n][8].stringValue != " " { // when signal value is present
                        str = str + " SIGNALRANGE=\"" + json["pageTables"][i]["tables"][n][8].stringValue.replacingOccurrences(of: " ", with: "") + ".000000 " + json["pageTables"][i]["tables"][n][9].stringValue.replacingOccurrences(of: " ", with: "") + ".000000" + " " + json["pageTables"][i]["tables"][n][13].stringValue.replacingOccurrences(of: " ", with: "")+"\""
                    }
                    str = str + "\n$END-FDS\n*\n"
                    n+=1
                }
            }
            i+=1
        }
        str += "*\n$END-RECEIVER\n********************************************************************************"

        return str
    }
    
    
    
